_data = """

""".strip()


def process(data):
    polymer = ''
    for letter in data:
        if len(polymer) > 0 and letter.lower() == polymer[-1].lower() and letter != polymer[-1]:
            # The same letter, but with different capitaliaation
            polymer = polymer[:-1]
        else:
            polymer += letter
    return polymer


def run():
    part_1()
    part_2()


def part_1():
    polymer = react_polymer(_data)
    print(len(polymer))


def part_2():
    unieque_letters = set(_data.lower())
    polymer = react_polymer(_data)
    min_length = len(polymer)
    for letter in unieque_letters:
        reduced_polymer = react_polymer(polymer.replace(letter, '').replace(letter.upper(), ''))
        if len(reduced_polymer) < min_length:
            min_length = len(reduced_polymer)
    print(min_length)


def react_polymer(data):
    changed = True
    while changed:
        processed = process(data)
        if processed == data:
            changed = False
        else:
            data = processed
    return data


if __name__ == '__main__':
    run()
